import react from 'react';

import Navigation from '../components/Navigation/Navigation3';
import Footer from '../components/Footer';

import './Gallery.css';

const Gallery = () => {
  return (
    <div class='bg'>
      <Navigation />
      <Footer />
    </div>
  );
};

export default Gallery;
